# Mikhaylovka, Yanurusovsky Selsoviet, Ishimbaysky District, Republic of Bashkortostan

}}
Mikhaylovka () is a rural locality (a village) in Yanurusovsky Selsoviet, Ishimbaysky District, Bashkortostan, Russia. The population was 26 as of 2010.
Geography
It is located 42&nbsp;km from Ishimbay and 4&nbsp;km from Yanurusovo.
